<head>
  <title></title>
  <meta charset="utf-8" />
  <meta name="viewport" content="width=device-width, initial-scale=1">
  <link rel="icon" href="https://www.doctolib.fr/favicon.ico">
  <style>
    body {
      margin: 0;
      border-top: 5px solid #3498db;
      background-color: #e7f6fb;
      font-family: "Roboto", Arial, sans-serif;
    }
    body .flex {
      display: flex;
      flex-direction: column;
      justify-content: space-between;
      min-height: 100vh;
    }
    body .dl-main-navbar {
      background-color: #0596de;
      padding: 10px 0;
      height: 55px;
    }
    body .dl-main-navbar img.dl-main-navbar-logo {
      width: 120px;
      height: 120px;
      margin-left: 14px;
      margin-top: -35px;
      position: absolute;
    }
    body .container {
      text-align: center;
      padding-top: 30px;
      padding-bottom: 30px;
    }

    body .dl-service-unavailable-footer {
      background: linear-gradient(180deg, rgba(0,160,224,0) 0%, #00a0e0 100%);
      width: 100%;
      z-index: 1;
    }

    body .dl-service-unavailable-footer img {
      width: 100%;
      max-width: 900px;
      display: block;
      margin: auto;
    }

    body .dl-service-unavailable-footer .dl-service-unavailable-footer-fill {
      background-color: #fff;
      height: 47px;
      width: 100%;
      z-index: -1;
    }

    .color-dot {
      border-radius: 99px;
      display: inline-block;
      width: 10px;
      height: 10px;
      margin-right: 5px;
    }
    .color-dot.critical {
      background-color: #e74c3c;
    }
    .color-dot.major {
      background-color: #e67e22;
    }
    .color-dot.minor {
      background-color: #f1c40f;
    }
    .color-dot.none {
      background-color: #2ecc71;
    }
    h1 {
      color: rgb(5, 150, 222);
      font-size: 26px;
      font-weight: 400;
      -webkit-font-smoothing: antialiased;
      padding-bottom: 12px;
    }
    h4 {
      color: rgb(5, 150, 222);
      font-size: 18px;
      line-height: 20px;
      font-weight: 300;
      -webkit-font-smoothing: antialiased;
    }
    p {
      color: rgb(67, 95, 113);
      font-size: 16px;
      line-height: 18px;
      -webkit-font-smoothing: antialiased;
    }
    img.dl-cross-logo {
      width: 120px;
      height: 120px;
    }
    #challenge-form {
      display: inline-block;
    }
  </style>
<meta http-equiv="refresh" content="390">
